import React from 'react';
import { Navbar, NavbarBrand, Nav, NavItem } from 'reactstrap';
import { NavLink } from 'react-router-dom';

export class NavbarComponent extends React.Component<any,any> {
  render() {
    return (
    <div>
      {/* just writing the name of a prop is shorthand for prop={true}*/}
      <Navbar>
        <NavbarBrand className="sublogo" href="/">Reimbursements</NavbarBrand>
        <Nav className="mr-auto" navbar>
          <NavItem>
            <NavLink to="/clicker">clicker</NavLink>
          </NavItem>
          <NavItem>
            <NavLink to="/login">login</NavLink>
          </NavItem>
          <NavItem>
            <NavLink to="/hello">welcome</NavLink>
          </NavItem>
          <NavItem>
            <NavLink to="/swapi">swapi</NavLink>
          </NavItem>
          <NavItem>
            <NavLink to="/books">books</NavLink>
          </NavItem>
        </Nav>

      </Navbar>
    </div>
    )
    }
}
